import React from 'react'

class UserInput extends React.Component {
    constructor(props) {
        super(props)
        this.handleChange = this.handleChange.bind(this)
      }

      handleChange(event) {
        const target = event.target;
        const name = target.name;
        this.props.onChangeInput(target.value)
      }
  render() {
    return( <div>
        <h1>Users</h1>
        <form>
        <input 
          type="text"
          name="nameFirst"
          value={this.props.nameFirst}
          onChange={this.handleChange}
        />
        <input
          type="text"
          name="nameLast"
          value={this.props.nameLast}
          onChange={this.handleChange}
        />
        <input
          type="text"
          name="nameAddress"
          value={this.props.nameAddress}
          onChange={this.handleChange}
        />
        <input
          type="text"
          name="nameCity"
          value={this.props.nameCity}
          onChange={this.handleChange}
        />
        <input
          type="text"
          name="nameState"
          value={this.props.nameState}
          onChange={this.handleChange}
        />
        <input
          type="number"
          name="nameZipcode"
          value={this.props.nameZipcode}
          onChange={this.handleChange}
        />
        <input
          type="email"
          name="nameEmail"
          value={this.props.nameEmail}
          onChange={this.handleChange}
        />
        </form>
        </div>)
  }
}

export default UserInput;
